Уютные Текстиля
предлагается в аренду очень стильное и эргономичное помещение-студия в 12ти минутах ходьбы по зеленым уютным дворикам от м. Текстильщики.  До центральных улиц Москвы можно добраться за 25 минут.
ИНФРАСТРУКТУРА
Комплекс походит на клубный дом, три невысоких в три этажа корпуса, на территории - зоны отдыха, зоны игры в настольный теннис и столы для игр в шашки и шахматы, есть кафе, на территории расположен ПВЗ Озон. На противоположной стороне улицы находится ЖК от ПИК, с возможностью пользоваться доступами к кофейням и магазинчикам. Для тех, кто передвигается на автомобиле, также очень удобная транспортная развязка, бонусом - всегда доступная парковка на закрытой территории без дополнительной платы. В инфраструктуру комплекса также входит тренажерный зал без дополнительной платы
ЧТО ВНУТРИ
Студия оснащена всем необходимым для комфортной жизни:
- стиральная машина с сушкой; 
- фильтры очистки питьевой воды;
- двухкомфорочная варочная панель;
- вытяжка;
- посудомоечная машина;
- холодильник;
- микроволновая печь;
- утюг;
- кондиционер;
- пылесос;
- достаточное количество мест хранения.
- уютная подсветка.

Студия подойдет для одного/пары активных горожан, не сидящих на месте - заезжай и живи. Только после ремонта, все новое, никто не жил, техникой не пользовались. успевайте быть первыми! Фотографии соответствуют реальности.

Оплата квитанции перевыставляется отдельно 

Собственник.
